export const Users = async () =>{
    const res = await fetch("https://localhost:44327/Submit/get");

    const userTable =  res.map(users => {
            return (
                <tr>
                <td>{users.firstname}</td>
                <td>{users.lastname}</td>
                <td>{users.begindate}</td>
                <td>{users.enddate}</td>
                <td>{users.hours}</td>
                </tr>
            )
    }
    )

    return(
        <div className="container">
            <h2>Users</h2>
            <table className="table table-bordered">
                <thead>
                <tr>
                    <th>User Id</th>
                    <th>Firstname</th>
                    <th>Lastname</th>
                    <th>begin date</th>
                    <th>end date</th>
                    <th>hours</th>
                </tr>
                </thead>
                <tbody>
                    {userTable}
                </tbody>
            </table>
        </div>
    )

    
}
